import './ImageLinkForm.css';


const ImageLinkForm = ( {}) =>{
    return(
        <div>
            <p>
                {'This Magic Brain app will detect faces in your pictures. Give it a try!'}
            </p>
            <div className="center">
                <input type="text" onChange={onInputChange} />
                <button>Detect</button>
            </div>
        </div>
    );
}
export default ImageLinkForm;
